import { Link, Route, Routes } from 'react-router-dom';
import './App.css';
import Home from './pages/Home';
import About from './pages/About';

function App() {
  return (<> 
  <nav>
    <ul>
      <li><Link>Home</Link></li>
      <li><Link></Link></li>
      <li><Link></Link></li>
    </ul>
  </nav>
  <Routes>
      <Route path='/' element={<Home/>}/>
      <Route path='about' element={<About/>}/>
    </Routes>
    </>

  );
}

export default App;
